INSERT INTO `chapitres` VALUES (1,'1.1.1-1','DWB-1.1.1-1','Qu’est-ce qu’un wireframe ?','https://solicode-web-mobile.github.io/autoformations-web/comprendre-maquettage/quest-ce-qu-un-wireframe/','Comprendre ce qu’est un wireframe et son utilité dans un projet web.',1,1,1,6,NULL,'2025-09-15 06:50:21','2025-09-15 06:50:21'),(2,'1.1.1-2','DWB-1.1.1-2','Cycle de vie d’un projet web','https://solicode-web-mobile.github.io/autoformations-web/comprendre-maquettage/cycle-vie-projet-web/','Découvrir les étapes d’un projet web et le rôle du maquettage.',1,10,1,6,NULL,'2025-09-15 06:50:21','2025-09-15 06:50:22'),(3,'1.1.2-3','DWB-1.1.2-3','Outils de maquettage','https://solicode-web-mobile.github.io/autoformations-web/comprendre-maquettage/outils-maquettage/','Découvrir les outils de wireframe et prototypage.',1,9,1,7,NULL,'2025-09-15 06:50:22','2025-09-15 06:50:22'),(4,'1.1.2-4','DWB-1.1.2-4','S’initier à Figma','https://solicode-web-mobile.github.io/autoformations-web/comprendre-maquettage/initier-figma/','Prendre en main Figma pour créer des wireframes.',1,8,1,7,NULL,'2025-09-15 06:50:22','2025-09-15 06:50:22'),(5,'1.1.2-5','DWB-1.1.2-5','Créer une maquette simple','https://solicode-web-mobile.github.io/autoformations-web/comprendre-maquettage/creer-maquette-simple/','Créer une maquette interactive d’une page web avec Figma.',2,7,1,7,NULL,'2025-09-15 06:50:22','2025-09-15 06:50:22'),(6,'1.2.1-1','DWB-1.2.1-1','Notions d’UX & Design Thinking','https://solicode-web-mobile.github.io/autoformations-web/concevoir-ux-ui/notions-ux-design-thinking/','Comprendre les principes fondamentaux de l’UX et la démarche Design Thinking. ',1,1,1,8,NULL,'2025-09-15 06:50:22','2025-09-15 06:50:22'),(7,'1.2.1-2','DWB-1.2.1-2','Règles d’ergonomie','https://solicode-web-mobile.github.io/autoformations-web/concevoir-ux-ui/regles-ergonomie/','Comprendre les principes d’ergonomie web et améliorer l’accessibilité. ',1,10,1,8,NULL,'2025-09-15 06:50:22','2025-09-15 06:50:22'),(8,'1.2.2-3','DWB-1.2.2-3','Notions d’UI','https://solicode-web-mobile.github.io/autoformations-web/concevoir-ux-ui/notions-ui/','Découvrir les principes de conception d’une interface utilisateur efficace.',1,9,1,9,NULL,'2025-09-15 06:50:22','2025-09-15 06:50:22'),(9,'1.2.2-4','DWB-1.2.2-4','Design responsive','https://solicode-web-mobile.github.io/autoformations-web/concevoir-ux-ui/design-responsive/','Savoir adapter une interface web à différents supports (mobile, tablette, desktop).',1,8,1,9,NULL,'2025-09-15 06:50:22','2025-09-15 06:50:22'),(10,'1.2.2-5','DWB-1.2.2-5','Relecture critique d’une maquette','https://solicode-web-mobile.github.io/autoformations-web/concevoir-ux-ui/relecture-critique-maquette/','Analyser et auditer une maquette web pour identifier ses points forts et faiblesses.',2,7,1,9,NULL,'2025-09-15 06:50:22','2025-09-15 06:50:22'),(11,'2.1.1-1','DWB-2.1.1-1','Structure de base d’une page HTML','https://solicode-web-mobile.github.io/autoformations-web/structurer-html/structure-base/','Être capable de créer la structure minimale d’une page web valide en HTML5.',1,1,1,10,NULL,'2025-09-15 06:50:22','2025-09-15 06:50:22'),(12,'2.1.1-2','DWB-2.1.1-2','Balises de texte, images, médias, tableaux et listes','https://solicode-web-mobile.github.io/autoformations-web/structurer-html/balises-textes-medias/','Savoir utiliser les balises HTML de base pour afficher du texte, images et listes.',2,11,1,10,NULL,'2025-09-15 06:50:22','2025-09-15 06:50:22'),(13,'2.1.2-4','DWB-2.1.2-4','Inputs, labels et groupes de champs','https://solicode-web-mobile.github.io/autoformations-web/structurer-html/inputs-labels-groupes/','Créer des formulaires HTML en utilisant des champs de saisie et labels accessibles. ',2,10,1,11,NULL,'2025-09-15 06:50:22','2025-09-15 06:50:22'),(14,'2.1.2-3','DWB-2.1.2-3','Validation et accessibilité','https://solicode-web-mobile.github.io/autoformations-web/structurer-html/validation-accessibilite/','Mettre en place la validation native HTML et améliorer l’accessibilité des