er les pages web. ',26,9,'2025-09-15 06:50:08','2025-09-15 06:50:09'),(8,'DWB-3.1','JavaScript : Premiers pas','Découvrir les bases du langage JavaScript','3.1','https://solicode-web-mobile.github.io/autoformations-web/javascript-premiers-pas/','Découvrir les bases de JavaScript pour créer des interactions. ',27,10,'2025-09-15 06:50:08','2025-09-15 06:50:09'),(9,'DWB-3.2','JavaScript : Aller plus loin','Approfondir les concepts et APIs JavaScript','3.2','https://solicode-web-mobile.github.io/autoformations-web/javascript-aller-plus-loin/','Approfondir JavaScript pour manipuler les données et APIs. ',28,10,'2025-09-15 06:50:08','2025-09-15 06:50:09'),(10,'DWB-4.1','Démarrer avec WordPress','Installer et configurer un site WordPress','4.1','https://solicode-web-mobile.github.io/autoformations-web/demarrer-wordpress/','Apprendre les fondamentaux de WordPress pour créer un site. ',29,14,'2025-09-15 06:50:08','2025-09-15 06:50:09'),(11,'DWB-5.1','Concevoir une base relationnelle','Modéliser et créer une base SQL','5.1','https://solicode-web-mobile.github.io/autoformations-web/concevoir-base-relationnelle/','Concevoir et modéliser une base de données relationnelle. ',30,11,'2025-09-15 06:50:08','2025-09-15 06:50:09'),(12,'DWB-5.2','Requêtes et manipulation SQL','Lire et manipuler des données SQL','5.2','https://solicode-web-mobile.github.io/autoformations-web/requetes-manipulation-sql/','Maîtriser les requêtes SQL pour interroger et modifier les données. ',31,11,'2025-09-15 06:50:08','2025-09-15 06:50:09'),(13,'DWB-6.1','Connecter une application à une base de données','Connexion et requêtes sécurisées avec PDO','6.1','https://solicode-web-mobile.github.io/autoformations-web/connecter-application-bdd/','Apprendre à connecter une application à une base de données via PDO. ',32,12,'2025-09-15 06:50:08','2025-09-15 06:50:09'),(14,'DWB-7.1','Bases et logique PHP','Découvrir la syntaxe et la logique en PHP','7.1','https://solicode-web-mobile.github.io/autoformations-web/bases-