loquent-avance/','Requêtes complexes, transactions ACID, index, sauvegarde et privilèges SQL.',4,2,'2025-09-15 06:50:08','2025-09-15 06:50:08'),(22,'DMB-C3.0','Rappel PHP & POO','PHP moderne, POO, CLI & JSON','C3.0','https://solicode-web-mobile.github.io/autoformation-mobile/php-poo/','Révision PHP moderne et POO : classes, interfaces, CLI, JSON, Composer.',5,3,'2025-09-15 06:50:08','2025-09-15 06:50:08'),(23,'DMB-C3.1','CRUD avec Laravel','Installer, MVC, formulaires & CRUD','C3.1','https://solicode-web-mobile.github.io/autoformation-mobile/laravel-crud/','Installer Laravel, comprendre MVC, créer un CRUD simple avec formulaires sécurisés.',6,3,'2025-09-15 06:50:08','2025-09-15 06:50:08'),(24,'DMB-C3.2','API REST','Endpoints JSON, pagination, contrat API','C3.2','https://solicode-web-mobile.github.io/autoformation-mobile/api-rest/','Construire une API Laravel REST : routes JSON, pagination, resources, contrat API.',7,3,'2025-09-15 06:50:08','2025-09-15 06:50:08'),(25,'DMB-C3.3','Sécurité & gestion des erreurs','Auth, policies, exceptions, logs','C3.3','https://solicode-web-mobile.github.io/autoformation-mobile/securite/','Mettre en place middlewares, policies, gestion centralisée des exceptions et logs.',8,3,'2025-09-15 06:50:09','2025-09-15 06:50:09'),(26,'DMB-C4.1','Git & GitFlow','Dépôt propre, branches, PR & merge','C4.1','https://solicode-web-mobile.github.io/autoformation-mobile/git-gitflow/','Mettre en place un dépôt Git propre, appliquer GitFlow minimal et gérer PR/merge.',9,4,'2025-09-15 06:50:09','2025-09-15 06:50:09'),(27,'DMB-C4.2','Agile & Scrum (basique)','Rôles, rituels, backlog, sprint 1 semaine','C4.2','https://solicode-web-mobile.github.io/autoformation-mobile/agile-scrum/','Découvrir Scrum allégé : rôles, artefacts, backlog, estimation, sprint et rétrospective.',10,4,'2025-09-15 06:50:09','2025-09-15 06:50:09'),(28,'DMB-C5.1','Bien démarrer le Mobile','Android Studio, projet Compose, APK','C5.1','https://solicode-web-mobile.github.io/autoformation-mobile/mobile-onboarding/','Installer Android Studio, créer premier projet, livrer APK debug et mini-app Hello.',11,5,'2025-09-15 06:50:09','2025-09-15 06:50:09'),(29,'DMB-C5.2','Kotlin essentiel','Null-safety, fonctions, data class','C5.2','https://solicode-web-mobile.github.io/autoformation-mobile/kotlin-essentiel/','Écrire du code Kotlin concis et sûr : null-safety, fonctions, data class, collections.',12,5,'2025-09-15 06:50:09','2025-09-15 06:50:09'),(30,'DMB-C5.3','Android avec Compose','UI Compose, état, navigation basique','C5.3','https://solicode-web-mobile.github.io/autoformation-mobile/android-compose/','Construire des écrans Compose, gérer état local, MVVM léger et navigation.',13,5,'2025-09-15 06:50:09','2025-09-15 06:50:09'),(31,'DMB-C5.4','Consommer une API','Retrofit/Coroutines, états UI, erreurs','C5.4','https://solicode-web-mobile.github.io/autoformation-mobile/android-api/','Appeler une API REST avec Retrofit, gérer UI states et erreurs réseau.',14,5,'2025-09-15 06:50:09','2025-09-15 06:50:09'),(32,'DMB-C6.1','Tests unitaires Laravel','Pest/PHPUnit : HTTP, DB, fakes','C6.1','https://solicode-web-mobile.github.io/autoformation-mobile/tests-laravel/','Écrire des tests unitaires et d’intégration avec Pest/PHPUnit (HTTP, DB, fakes).',15,6,'2025-09-15 06:50:09','2025-09-15 06:50:09'),(33,'DMB-C7.1','Logique binaire & matériel','Binaire/hex, CPU/RAM, OS & services','C7.1','https://solicode-web-mobile.github.io/autoformation-mobile/binaire-matériel/','Découvrir logique binaire, composants matériels et OS de base.',16,7,'2025-09-15 06:50:09','2025-09-15 06:50:09'),(34,'DMB-C7.2','LAN & IP','Switch/routeur, VLAN, IPv4/DHCP, diag','C7.2','https://solicode-web-mobile.github.io/autoformation-mobile/lan-ip/','Apprendre adressage IPv4/IPv6, VLANs, DHCP et outils réseau.',17,7,'2025-09-15 06:50:09','2025-09-15 06:50:09'),(35,'DMB-C7.3','Serveur Web (HTTP/HTTPS)','Méthodes/codes, TLS, PHP-FPM, logs','C7.3','https://solicode-web-mobile.github.io/autoformation-mobi