INSERT INTO `projets` VALUES (1,'Jeu de mémorisation du programme Solicode','Jeu éducatif en JS console pour mémoriser les 8 compétences (C1 à C8).','Code uniquement JS, score, validation des réponses.',NULL,5,2,1,'Jeu de mémorisation du programme Solicode-0005','2025-09-15 07:12:33','2025-09-15 07:12:33'),(2,'Jeu de mémorisation du programme Solicode','Jeu éducatif en JS console pour mémoriser les 8 compétences (C1 à C8).','Code uniquement JS, score, validation des réponses.',NULL,2,2,1,'Jeu de mémorisation du programme Solicode-0002','2025-09-15 07:12:48','2025-09-15 07:12:48'),(4,'Jeu de mémorisation du programme Solicode','Jeu éducatif en JS console pour mémoriser les 8 compétences (C1 à C8).','Code uniquement JS, score, validation des réponses.',NULL,4,2,1,'Jeu de mémorisation du programme Solicode-0004','2025-09-15 07:22:10','2025-09-15 07:22:10'),(5,'Calculatrice logique binaire','<p>Construire une <b>mini-calculatrice CLI</b> qui :</p><ol><li>Convertit un entier en binaire/hexadécimal.</li><li>Accepte deux entiers et applique les opérateurs logiques :<ul><li>ET (&amp;)</li><li>OU (|)</li><li>XOR (^)</li><li>NON (~)</li></ul></li><li>Affiche un tableau clair des résultats.</li><li>Valide les entrées (entiers positifs) et gère les erreurs.</li></ol><p><b>Exemple :</b></p><p><b></b></p><pre><code class=\"language-bash\">php bin/calc.php 5 3\r\nEntrée A : 5 (101)\r\nEntrée B : 3 (011)\r\nA ET B : 1 (001)\r\nA OU B : 7 (111)\r\nA XOR B: 6 (110)\r\nNON A : -6 (…11111010)</code></pre><b><br></b><p></p>','<ul><li><b>PSR-4</b>, classes Converter &amp; Calculator</li><li><b>Scripts Composer</b> : build, validate, save</li><li><b>README.md</b> avec exemples d’utilisation</li><li>Échantillons versionnés (samples/input.txt, samples/output.json)</li></ul>',NULL,1,1,19,'Calculatrice logique binaire-0001','2025-09-15 08:51:06','2025-09-15 08:51:06'),(7,'Jeu de mémorisation du programme Solicode','Jeu éducatif en JS console pour mémoriser les 8 compétences (C1 à C8).','Code uniquement JS, score, validation des réponses.',NULL,3,2,1,'Jeu de mémorisation du programme Solicode-0003','2025-09-15 10:44:23','2025-09-15 10:44:23');
