INSERT INTO `session_formations` VALUES (1,'DWB-S1','S1','SAS & Logique + Découverte pédagogique',1,'2025-09-15','2025-09-26','Aucun','SAS & Logique + Découverte pédagogique','Comprendre la pédagogie active, initier la logique JS (variables, conditions, boucles), découvrir Git &amp; GitHub, et réaliser un premier mini-projet en console.&nbsp;','Session préparatoire.','Décompteur de compétences Solicode','Script JS parcourant un tableau de compétences et comptant les occurrences d\'un code choisi, en console.','JavaScript en console uniquement, dépôt GitHub.','Jeu de mémorisation du programme Solicode','Jeu éducatif en JS console pour mémoriser les 8 compétences (C1 à C8).','Code uniquement JS, score, validation des réponses.',2,1,'2025-09-15 06:50:37','2025-09-15 06:50:37'),(2,'DWB-S2','S2','HTML – Fondamentaux',2,'2025-09-29','2025-10-10','Aucun','HTML – Fondamentaux','Structurer une page HTML, balises courantes, formulaire accessible, mini-site 3 pages.','Première brique du projet fil rouge (blog).','Page profil Solicode','Page HTML unique avec profil d’apprenant, balises sémantiques et formulaire accessible.','HTML sémantique uniquement, sans CSS/JS.','Mini-site HTML – Présentation personnelle','Mini-site statique (3 pages : accueil, CV, contact).','Navigation interne cohérente, code HTML valide.',2,1,'2025-09-15 06:50:37','2025-09-15 06:50:37'),(3,'DWB-S3','S3','CSS – Mise en forme & Layout',3,'2025-10-13','2025-10-24','Aucun','CSS – Mise en forme & Layout','Bases du CSS, propriétés fondamentales, Flexbox et Grid, stylisation du blog (projet fil rouge).',NULL,'Maquette stylisée d’une page d’accueil','Ajout de styles CSS (texte, couleurs, alignement) sur la page HTML produite en S02.','Utilisation de Flexbox et Grid uniquement.','Blog statique – version stylisée','Version stylisée des 3 pages HTML de S02.','CSS personnalisé, pas de bibliothèque externe.',2,1,'2025-09-15 06:50:37','2025-09-15 06:50:37'),(4,'DWB-S4','S4','JavaScript – Premiers pas',4,'2025-10-27','