  CONSTRAINT `widgets_type_id_foreign` FOREIGN KEY (`type_id`) REFERENCES `widget_types` (`id`) ON DELETE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=13 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;
